import React from "react";
import CartItem from "./CartItem";

const Cart = ({ cart }) => {
  const mappedCartItems = cart.map((item) => {
    return (
      <CartItem name={cart.name} price={cart.price} quantity={cart.quantity} />
    );
  });

  return (
    <div>
      <h2>Cart</h2>
      <div>
        <h4>Items</h4>
        {mappedCartItems}
      </div>
    </div>
  );
};

export default Cart;
